import React from 'react';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
     monster:[{
         name:""
     },{
        name:""
    },{
        name:"granny"
    },]
    };
  }
  use = () => {
    return this.state.fam.map(name => <li key={name.age}>{name.gName}</li>);
  };
  render() {
    return (
      <div>
        hi
        {this.use()}
      </div>
    );
  }
}

export default App;
